import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Logo from '../images/logo.png';

export default function Navigation() {
  const [keyword, setKeyword] = useState('');
  const [isDarkMode, setIsDarkMode] = useState(false); // State for theme mode

  const handleSearch = (e) => {
    setKeyword(e.target.value);
  };

  const toggleTheme = () => {
    setIsDarkMode(!isDarkMode);
  };

  return (
    <nav className={`navbar navbar-expand-lg ${isDarkMode ? 'bg-dark' : 'bg-body-tertiary'}`}>
      <div className="container-fluid">
        <img src={Logo} alt="Logo" style={{ width: '40px', height: 'auto', marginRight: '10px' }} />
        <Link className={`navbar-brand ${isDarkMode ? 'text-white' : 'text-dark'}`} to="/">Deepak's Car Zone</Link>

        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <Link className={`nav-link ${isDarkMode ? 'text-white' : 'text-dark'}`} to="/">Home</Link>
            </li>
            <li className="nav-item dropdown">
              <button className={`nav-link dropdown-toggle btn btn-link ${isDarkMode ? 'text-white' : 'text-dark'}`} type="button" id="navbarDropdown" data-bs-toggle="dropdown" aria-expanded="false">
                Categories
              </button>
              <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
                <li><Link className="dropdown-item" to="/search/Sedan">Sedan</Link></li>
                <li><Link className="dropdown-item" to="/search/SUV">SUV</Link></li>
              </ul>
            </li>
          </ul>
          <div className="d-flex">
            <input className={`form-control me-2 ${isDarkMode ? 'bg-dark text-white' : 'bg-white text-dark'}`} type="text" placeholder="Search" value={keyword} onChange={handleSearch} />
            <Link className={`btn ${isDarkMode ? 'btn-outline-light' : 'btn-outline-success'}`} to={`/search/${keyword}`}>Search</Link>
          </div>
          <Link className={`btn ${isDarkMode ? 'btn-light' : 'btn-primary'} mx-2`} to="/addproduct">Add Product</Link>  

          {/* Theme Toggle Button */}
          <button className={`btn ${isDarkMode ? 'btn-light' : 'btn-dark'} mx-2`} onClick={toggleTheme}>
            {isDarkMode ? 'Light Mode' : 'Dark Mode'}
          </button>
        </div>
      </div>
    </nav>
  );
}
